<template>
  <div class="down">
    <pdf ref="pdf" :src="pdfUrl"></pdf>
    <a>‰∏ãËΩΩÊåâÈíÆ</a>
  </div>
</template>

<script>
import pdf from "vue-pdf";
export default {
  components: { pdf },
  methods: {
    //base64 ËΩ¨Êç¢ blob
    base64ToBlob() {
      let arr = this.pdfUrl.split(",");
      // let array = arr[0].match(/:(.*?);/);
      // let mime = array && array.length > 1 ? array[1] : "pdf";
      // ÂéªÊéâurlÁöÑÂ§¥ÔºåÂπ∂ËΩ¨Âåñ‰∏∫byte
      let bytes = window.atob(arr[1]);
      // Â§ÑÁêÜÂºÇÂ∏∏,Â∞ÜasciiÁ†ÅÂ∞è‰∫é0ÁöÑËΩ¨Êç¢‰∏∫Â§ß‰∫é0
      let ab = new ArrayBuffer(bytes.length);
      // ÁîüÊàêËßÜÂõæÔºàÁõ¥Êé•ÈíàÂØπÂÜÖÂ≠òÔºâÔºö8‰ΩçÊó†Á¨¶Âè∑Êï¥Êï∞ÔºåÈïøÂ∫¶1‰∏™Â≠óËäÇ
      let ia = new Uint8Array(ab);
      for (let i = 0; i < bytes.length; i++) {
        ia[i] = bytes.charCodeAt(i);
      }
      return new Blob([ab], {
        type: "application/octet-stream",
      });
    },
    load() {
      this.$nextTick(() => {
        const dom = document.querySelector(".down");
        const a = document.querySelector("a");
        // console.log(`üçâ ~ this.$nextTick ~ a`, a);
        let myBlob = this.base64ToBlob();
        let myUrl = URL.createObjectURL(myBlob);
        console.log(`üçâ ~ this.$nextTick ~ myUrl`, myUrl);
        this.downUrl = myUrl;
        a.setAttribute("download", "ÈááË¥≠Âçï.pdf");
        a.setAttribute("target", "_self");
        a.setAttribute("href", myUrl);
        dom.appendChild(a);
      });
    },
  },
  data() {
    return {
      downUrl: "",
      pdfUrl:
        "data:application/pdf;base64,",
    };
  },
  mounted() {
    this.load();
  },
};
</script>

